import React from 'react';
import './Courses.css';

const Courses = () => {
  const courses = [
    {
      id: 1,
      title: 'Lập trình Web',
      description: 'HTML, CSS, JavaScript, React và Node.js',
      level: 'Cơ bản',
      duration: '3 tháng',
      image: '/images/web-dev.jpg'
    },
    {
      id: 2,
      title: 'Lập trình Python',
      description: 'Python cơ bản đến nâng cao, Data Science',
      level: 'Trung bình',
      duration: '4 tháng',
      image: '/images/python.jpg'
    },
    {
      id: 3,
      title: 'Phát triển ứng dụng Mobile',
      description: 'React Native, Android, iOS Development',
      level: 'Nâng cao',
      duration: '4 tháng',
      image: '/images/mobile-dev.jpg'
    },
    {
      id: 4,
      title: 'AI & Machine Learning',
      description: 'Trí tuệ nhân tạo và học máy với Python',
      level: 'Nâng cao',
      duration: '6 tháng',
      image: '/images/ai-ml.jpg'
    }
  ];

  return (
    <section className="courses-section">
      <div className="container">
        <h2 className="section-title">Các Khóa Học</h2>
        <p className="section-description">
          Khám phá các khóa học chất lượng cao tại TechKids
        </p>

        <div className="courses-grid">
          {courses.map(course => (
            <div key={course.id} className="course-card">
              <div className="course-image">
                <img src={course.image} alt={course.title} />
                <div className="course-level">{course.level}</div>
              </div>
              
              <div className="course-content">
                <h3 className="course-title">{course.title}</h3>
                <p className="course-description">{course.description}</p>
                
                <div className="course-details">
                  <span className="course-duration">
                    <i className="far fa-clock"></i>
                    {course.duration}
                  </span>
                </div>

                <button className="btn-register">
                  Đăng ký ngay
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Courses;
